@Bowser junior Studios I'm hopeful that they do. Still, climate change will have nothing to do with their success or failure, though, except maybe in places where people are generationally accustomed to waiting in queues which is my way of saying that a certain, limited portion of the world may think that way, but the entire rest of the world does not.
I can see Justin the Just of Canada decreeing such things in the least densely populated country in North America. 
I can also recall a conversation recorded not so long ago between an American and (I think) a Dutch person: "Oh, your bicycle, all the bicycles, how lovely." To which the Nederlander replied: "We only suffer bicycles because we can't afford cars."

@adajanetta1 But I mean they do, they just changed the titles (sometimes), became hired or centralized rather then live in, and usually became protected by more legal rights and higher paid. 

What he was describing in the video for instance is really is just a house cleaner, which many people do employ, lots of people still employ gardeners, childcare by others is common but you take the children too the carer rather then the inverse, etc. He was like I'd say half right here the general predication that individual servants associated with a family would decline to near non-existence was correct, but most of his predication about how that services would change were off. 

Then again to be fair servants were never really all that common to begin with, there was a small period where people below the very wealthy might have had them, but that period was fairly short and even then they never really migrated down much further then just 'wealthy'. Maaaybe at the very peak there was a small bit of infiltration down into the upper middle class, but generally the middle classes and down that made up most of the population even during these time periods did not commonly have servants.

@Old Fogey It very much depends on the metric, but even if it was entirely 100% true that could be attributed to a temporary setback rather than a permanent change in the way people view their prospects, as implied here. 

While it may be the case that the present generation are less well off financially (whatever that means), that does not mean that the generation after that cannot do better than anyone before them, which is my point. 

Just in case we start arguing I will agree with you in saying that the economic prospects for this generation are not exactly promising, particularly in light of recent events. There's this trend in China called "lying flat", where the truly daunting task of living just drives young people to give up, and live at the bare minimum. I could see something like that becoming worldwide.

